import React from "react";

const Stocks = () => {
  return (
    <div>
      <h1>Stocks</h1>
      <form>
        <label htmlFor="buy">Stock Buy Price : </label>
        <input id="buy"></input>
        <br></br>
        <label htmlFor="currentPrice">Stock Current Price : </label>
        <input id="currentPrice"></input>
        <butto type="submit">Submit</butto>
      </form>
    </div>
  );
};

export default Stocks;
